@okeeheepkee @RunzWithSiz0rs @Landshark_87 @nytpolitics You're so right. Moscow won't accept it, and neither will Simferopol. 

Most people don't understand that Crimea was only part of Ukraine for 60 years. 

Its Russian roots go back to 1783. It has a big ethnic-Russian majority.
